(1623, '114838', '2007-02-22 01:20', 1755, '15:52:43 Лена:\r\nЯ сегодня из интереса проверила папку удаленных пользователей. \r\nЦитирую:\r\n\r\n09.02.07 13:19    Mike: привет, ты симпатичная.... \r\nтебе нужен любовник?? \r\n09.02.07 13:21    Лена: привет, спасибо, нет   \r\n21.02.07 12:10    Mike: привет, ты симпатичная... \r\nтебе нужен любовник??? \r\n21.02.07 12:45    Лена: привет, спасибо, нет  \r\n\r\nслужба рассылок какая-то \r\n   \r\n15:54:32 Колька:\r\nда. это робот \r\n  \r\n15:54:32 Колька:\r\nА тебе нужен любовник? \r\n   \r\n15:55:57 Лена \r\nнужен', 99),
(1624, '114837', '2007-02-22 01:17', 2444, '<Blackguardfenix> 17 марта - 12 московский командный чемпионат по кендо. Вот там я и буду. Это суббота.\r\n\r\n<Шшок> Феникс, могу одолжить мой старый кий. Представь: все с мечами, а ты - с кием. Эффект неожиданности должен принести победу.\r\n\r\n<Чива Ротсен> У меня топор хороший есть, если совсем тебе там туго придется...\r\n', 99),
(1621, '114865', '2007-02-22 01:39', 1435, 'Neolord: Мне седня народ показал фотку с аспектом 3:4 - ну вертикальную. Я спрашиваю, мол, а че эт на ней - мол откуда кадр.\r\nNeolord: Мне отвечают - эт мол фотообои...\r\nNeolord: Следующие 10 минут я пытал людей - что эт за фотообои такие -как их с таким аспектом на десктоп лепить... На меня смотрели как будто я из дурки сбежал.\r\nNeolord: Вот так сегодня я узнал что такое фотообои. Оказывается, они не на десктоп, а на стену!! ', 99),
(1619, '114882', '2007-02-22 01:40', 2951, 'mikage_souji: Бухгалтерша только что постирала маячку, положила в микроволновку на 5 минут на 800 ватт и отошла в туалет. Этаж полон дыма и мата.\r\nНет, не блондинка.\r\nВся мужская часть с круглыми глазами ходит.\r\nblack_drozd: А женская - нет?\r\nmikage_souji: Женская смотрит понимающе-сочувственно.', 99),
(1620, '114868', '2007-02-22 01:39', 1291, '<flashkot> в моём офисе стоит телефон с внешним айпи...\r\n<axis> Всмысле "с внешним айпи"?\r\n<flashkot> твайумать!\r\n<flashkot> в смысле с нормальным городским номером...\r\n<axis> У нас тока три с "внешним айпишником" :)\r\n<flashkot> "вчера опять звонил на DNS"... (c)', 99),
(1616, '115051', '2007-02-22 02:14', 6254, 'Sokol: Меня девушка бросила, я нашел другую, но не могу забыть бывшую, мне фигова, что делать?\r\nReXXX: Маленький ты ещё\r\nHimeRa: Ещё не подрос\r\nNanA: Подрастешь узнаешь\r\nJordJ: Вырастешь поймешь\r\nMotor: Убей сипя\r\nSokol: Вывод: Каждый пятый человек в мире желает тебе зла, остальные просто считают себя опытней.', 99),
(1617, '115009', '2007-02-22 02:08', 19101, '<Jim> подошел к одногруппнице сегодня при всех\r\n<Jim> и спросил: "ты меня любишь?"\r\n<Jim> а она возьми и ответь: "да"\r\n<Jim> завтра, блять, на свидание иду\r\n<Jim> а хотел всего-лишь тетрадку с лекциями попросить отксерить', 99),
(1618, '114978', '2007-02-22 02:03', 1426, '<+^CooL-T> народ  как мне можно вырезат звук из двд фильма?\r\n<@KedR> ^CooL-T: самое простое запустить какойнить звуковой редактор или типа того, где можно записать звук, и в микшере звуковухизапись поставить активным канал wave или как у меня стерео микшер \r\n<@KedR> или рипнуть в ави, потом оттуда звук)\r\n<+k0rn> мдааа.. проктолог из тебя отменный получится', 99),
(1615, '115058', '2007-02-22 02:17', 1583, 'Sokol: Ходил курить, иду обратно, из соседнего кабинета крик "Жгут, жгут", думал что читают, оказалось секретарша руку сильно порезала канцелярским ножом :)', 99),
