(1605, '116219', '2007-02-23 01:35', 2496, 'OrangeOwl: Да это еще вообще фигня. Вот у меня друг имел мыло у какого-то известного прова, не помню... Так вот решил он как-то оставить у себя локальную копию веб-интерфейса.\r\nOrangeOwl: Запустил какую-то програмулину, типа TeleportPro, и давай сканить/сохранять залогившись на сайт.\r\nOrangeOwl: Программа сделала свою работу безупречно, на последок дошла до ссылки "удалить аккаунт" и благополучно запросила ее.\r\nOrangeOwl: Теперь у него осталась на память локальная версия ящика.', 99),
(1602, '116557', '2007-02-24 14:32', 4193, '[1]: письмо на наш офис от начальника\r\n[1]: Я думаю, что не стоит напоминать о том, что по стенам не бегать, на стульях не кататься, на столах не танцевать, водой не обливаться, едой не кидаться, мусорки не поджигать, курить только в отведенном месте, бычки на полу не растирать, из окон не прыгать и т.д. Если кому смешно, то я напомню, что почти все из вышеназванных развлечений уже были реализованы, после принятия определенных доз алкоголя. Не надо реализовывать остальные и те о которых мне даже трудно догадаться.\r\n[2]: гыгыгыгы\r\nначальнег у вас жжОт!!!!\r\nнаверняка сам участвовал во всех вышеперечисленных событиях\r\n[1]: неееееееее\r\n[1]: он тока мочалку в холодильник положил', 99),
