(1747, '593', '2005-06-16 12:28', 2561, '<AMorozov> Бизнес-процесс - это вполне понятное и привычное большинству админов дело.\r\n<AMorozov> Другое дело, что они, как правило, не формализованы.\r\n<AMorozov> Что делает обычный админ, когда у него сгорает вентилятор на его мощном сервере?\r\n<AMorozov> правильно, он берет два пива и идет к кладовщику.\r\n<AMorozov> В результате у начальства складывается впечатление, что эти двое только и делают, что бухают.\r\n<AMorozov> А если админ вначале пишет бумажку, что-де пойду к кладовщику за вентилятором, прихватив с собой пиво, и начальство эту бумажку визирует, то это уже называется не двое бухают, а бизнес-процесс.\r\n<AMorozov> Правда, в этом случае, возрастают накладные расходы у админа, т.к. он должет не только напоить кладовщика, но и начальника.\r\n', 9),
