(1802, '432042', '2015-01-23 08:46', 2441, 'Я когда на заводе работал, лет 20 назад, выдали спецодежду. Дали неплохие кожаные ботинки. Я их хорошенько салом промазал, и еще подумал, не погрызут ли их мышы. На следующий день придя на работу, обнаружил свой ящик вскрытым, и без спецухи, и без ботинок. Наверное мыши стащили. А точнее крысы. Лучше бы я их дерьмом намазал. И крыс тоже.', 999),
(1803, '432041', '2015-01-23 08:45', 3475, 'xxx: Густота и концентрация fairy в будущем дойдет до плотности черной дыры.', 999),
(1804, '432040', '2015-01-23 08:44', 2342, 'В доме было очень холодно, и тем не менее решили заняться с мужем сексом. По-быстренькому так, без прелюдий. Он натягивает одеяло на плечи, чтобы нас обоих им укрыть, но в этот момент кидает взгляд на себя в зеркале и задумчиво произносит: "охренеть, я Бэтмен!"', 999),
(1805, '432039', '2015-01-23 08:12', 1563, 'xxx: Блин, батарейка на материнке сдохла, дата съехала, терь я живу в 2095 году)\r\nххх: Печально осознавать то, что даже в 2095 году я не могу начать писать курсач :*(', 999),
(1806, '432038', '2015-01-23 08:11', 661, 'Муж за рулем рассказывает, как он пытался увести в дом замеченного им напившегося соседа, чтобы тот не замерз на морозе (-20), а сосед все пытался прикорнуть в своей незаведенной машине.\r\nВ середине разговора дочка (4 года) начинает активно дергать папу:\r\n- Папа, папа, а скажи пожалуйста...\r\n- Дочка, ты же видишь, взрослые разговаривают, подожди.\r\nДочка терпеливо дожидается окончания рассказа и задает сакраментальный вопрос:\r\n- Папа, откуда ты взял барабан!?\r\n- О_О\r\nНачинаем вспоминать разговор: "... и я стучу ему в стекло, стучу, а ему ПО-БАРАБАНУ!" )))\r\nЯ (тихо): Скажи спасибо, что она не спросила, где ты взял бубен...\r\n\r\n(Сосед был буен и дело шло к тому, чтобы зарядить ему в бубен, чтобы без увечий с обеих сторон довести до теплой квартиры).', 999),
(1807, '432037', '2015-01-23 08:11', 3437, 'Забегаю в метрополитен, он за мной, я в поезд, он вроде тоже успел в соседний вагон заскочить, перевел дыхание, проехал несколько станций, выпрыгиваю на гостинке и дую из вагона к переходу в центре станции на невский проспект. Его силуэт сразу увидел сзади, он мой тоже (еще бы мы друг друга не увидели - весь народ серо-черный, а мы два дебила в красных куртках - ему жена выбирала, мне - любовница и по совместительству его жена). \r\n\r\nКороче, пытаюсь оторваться, чтобы не получить по мордасам, а на спуске в переход пробка и ни хрена не пробиться, он уже почти близко, капли пота выступают на лбу, я пытаюсь что-то придумать... И тут единственная гениальная мысль приходит мне в голову, я достаю какую-то ручку и начинаю громко и выразительно говорить: "уважаемые, дамы и господа, сегодня я представляю Вашему вниманию, бла-бла-бла"... и, о чудо, народ сразу расступился и я пробежал вниз!\r\n\r\nСпам-реклама - ЗЛО! Но не получить по мордасам помогло )', 999),
(1808, '432036', '2015-01-22 12:46', 1792, 'Nadin Thirteen: все эти колонки на ножках\r\nNadin Thirteen: у вас есть акустика в свинцовом корпусе?\r\nNadin Thirteen: а чтоб током били? а с запахом лака для ногтей?\r\nNadin Thirteen: просто у меня котик...', 999),
(1809, '432035', '2015-01-22 12:12', 5313, 'никогда, слышите, никогда не оставляйте эмаль в аэрозоли в туалете !!!!!!!!!!!!', 999),
(1810, '432034', '2015-01-22 12:11', 12489, 'Трамвай. Едем, наверное, по самому разбитому полотну в городе. На остановке у завода подсаживается паренек. В трамвае все дребежжит, громыхает. Парень достает смартфон и такой в него: "ОК, Гугл. Где я?" (видимо в командировке у нас в городе). Смарт изза лязга ничего не понимает и парень продолжает уже настойчивее: "ОК, Гугл. Где я?". В этот момент трамвай останавливается и становится тихо. Парень, ловя момент, снова: "ОК, Гугл. Где я?", на что одна из бабушек на весь трамвай: "Ты в трамвае, а Гулю, наверное, на остановке оставил... Наркоманы!".', 999),
