(1814, '432030', '2015-01-22 11:44', 1968, 'ххх: Сегодня билеты покупал на вокзале, у кассирши фамилиё - Стебенько. Угадай, какие две буквы на ее бейджике были закрыты галстуком?\r\nууу: Гыгы )\r\nххх: Неа, не угадал. "ко".\r\nххх: "Стебень" - это забавно, конечно, но я взоржал, только когда мой друг, чувак с поэтической такой жилкой, сказал потом:\r\nххх: "И гордым стебнем я взмываю ввысь!"\r\nххх: ... и навернулся со ступенек вокзала.', 999),
