(1817, '432027', '2015-01-22 10:45', 6474, 'Валерий Серьёзный: В селе, на окраине поставили вышку. Толи мегафон, толи билайн, не знаю. Но у местных бабушек, как у одной, у всех появился шум в ушах и поднялось давление. Стали проклинать соседа, который разрешил эту вышку поставить у себя в огороде. Оказалось, что причиной поднятия давления была новость, что он за это неплохие бабки отхватил!', 999),
