(1821, '432023', '2015-01-22 10:12', 5486, 'ххх: у нас помнится препод отжёг. говорит, давайте для примера дадим определение человека. скажем, человек это существо с двумя ногами, двумя руками и одной головой. но это плохое определение. под понятие человека тогда попадает достаточно много народу.', 999),
(1822, '432022', '2015-01-22 10:11', 2582, 'xxx:\r\nСпасибо менеджеру за отличные коммуникации между отделами и внедрение свежих управленческих идей:\r\nклиентский отдел: мы всё записывали в журнал IT проблем\r\nIT-отдел: вау! у нас есть журнал IT проблем! :O', 999),
(1823, '432021', '2015-01-22 09:46', 11059, 'Сегодня утром сплю, никого не трогаю. Лежу на боку, сзади меня муж одной рукой обнимает и тихонько похрапывает в район моего загривка... Идиллия ) Звонит будильник, тянусь к тумбочке и тут открывается дверь и в комнату входит ...МУЖ!!!!! Визжала так, что аж охрипла!\r\nКогда проорлась, проревелась и отдышалась, выяснилось, что муж проснулся со сранья и на цыпочках ушел на кухню мародерить, а наш собак решил, что под одеядом ему будет теплее чем в кресле )))', 999),
(1824, '432020', '2015-01-22 09:13', 2745, 'bogomolec: у моей девушки есть привычка: когда она со мной валяется в обнимку, то издает звуки, похожие на мурчание кошки. Ну я, недолго думая, стал называть её Мурёной.\r\n\r\nЧерез некоторое время друг в переписке спросил, как я ласково называю свою девушку... Ну я и ответил - МУРЕНА. До сих пор подкалывает.', 999),
(1825, '432019', '2015-01-22 08:46', 2584, 'xxx: извините, мне любопытно что такое и как выглядит "неочищенный сахар" для орехового печенья??!!!\r\nyyy: ну...свеклу видела? вот так и выглядит.', 999),
(1826, '432018', '2015-01-22 08:13', 1557, 'xxx: Слава несовершенству технологий\r\nxxx: Пошел я под душ, а телефон-то водозащищенный, думаю: о, норм, можно ж из интернетов не вылезать\r\nxxx: Включил воду, залез, ползаю по контачу, хабру, 4пда и т.д.\r\nxxx: Один косяк: когда на экран попадает много капель воды, тачскрин сходит с ума и корректно определить нажатие не может - приходится высовываться из-под душа и полотенчиком экран протирать\r\nxxx: Вот так стою я, снова вода скапливается на экране, высовываю голову из-за занавески и случайно вижу часы\r\nxxx: По ним выходит, что моюсь уже час и двадцать минут\r\nxxx: По внутренним ощущениям времени прошло минут 10-15\r\nxxx: Страшно представить, что было бы, если б телефон нормально реагировал на залитый экран и вылезать протирать не надо было бы', 999),
(1827, '432017', '2015-01-22 08:12', 6152, 'Когда мне было лет 5, моя бабушка, врач, решила поздравить меня и младшего брата с новым годом. Она надела шубу, шапку. И нарисовала бороду и усы. Зеленкой.\r\nЯ рано перестал верить в Деда Мороза.\r\n', 999),
(1828, '432016', '2015-01-21 12:45', 1965, 'darkness.quatre: Да я вообще часто слышу сакральное "У меня не может быть вирусов на компе, у меня же АНТИВИРУС!". Задолбался людям объяснять. На днях придумал простой и понятный контр-ответ "А у меня кастрюля на голове - я теперь БЕССМЕРТНЫЙ".\r\nkuro: тогда уж лучше дуршлаг\r\nkuro: летающий макаронный монстр это вам не хухры мухры', 999),
(1829, '432015', '2015-01-21 12:44', 3178, 'Суровая питерская зима. На НГ выпал снег, потом была солнечная погода и оный снег растаял практически полностью. Потом ударил хороший морозец, настоящая зимняя погода, разве что снега нет. Идет семья с ребенком, ребенок гордо восседает на санках (классические советские, с узкими металлическими полозьями), которые по голому асфальту тащит отец. Скрежет на полквартала, прохожие разве что не ржут в голос, но ребенок довоооольный. Зима же, на санках самое оно =)', 999),
(1830, '432014', '2015-01-21 12:12', 2617, 'xxx: а помните в "Гарри Поттере" Гарри вечно гадал, видят ли кошки через мантию-невидимку, когда миссис Норрис на него глазела? Ведь видят же, в инфракрасном спектре видят теплую тушку под плащиком! И даже если мантия перекрывает видимость во всех спектрах, как они хотели спрятаться от ночного хищника? У нее есть вибриссы, которыми она чувствует колебания воздуха, уши, которыми она слышит даже как бьются их сердца, нос, которым она чует их запах, и может даже почувствовать, какого они пола, возраста и в каком состоянии сейчас (боятся, например), орган Якобсона тот же. Да кошка по книге должна была бы их закладывать только так, интересно, почему она этого не делала?', 999),
(1831, '432013', '2015-01-21 12:12', 3568, 'Крошечная портативная камера делает снимки каждые 30 секунд, создавая фотодневник владельца.\r\n\r\nian green: приехал из отпуска - сдал жене логи', 999),
(1832, '432012', '2015-01-21 11:46', 1272, 'Комментарий к новости о возвращении на ТВ "Секретный материалов":\r\n\r\nxxx: Скалли, ты опять проспала НЛО, клонов, мутантов и опыты над людьми! Но теперь я все снял на смартфон, с ты тупая!', 999),
(1833, '432011', '2015-01-21 11:12', 1657, 'В ФБ:\r\nххх: А теперь я задам вопрос, который волнует всех нас. Сколько может жить селедка под шубой? )))\r\nyyy: в жидком азоте — до нового пришествия, практически. Правда, на вкус может отдавать алюминием и немного железом.', 999),
(1834, '432010', '2015-01-21 11:11', 3216, 'Нахухоль: Странные существа эти женщины, толщину килограммами измеряют...', 999),
(1835, '432009', '2015-01-21 11:11', 5507, 'xxx: Handmade и handjob сильно разные по смыслу?\r\nyyy: кгхм. ну как тебе сказать...', 999),
(1836, '432008', '2015-01-21 10:45', 3609, 'Ххх: \r\nя тут кажись переработала. Нарисовалась подработка помимо основной работы - по всяким нормативным документам нужно составлять тестовые вопросы с вариантами ответов. Маленько увлеклась, в праздники сидела по 10-12 часов. В один из последних дней доползаю до кровати и радостно засыпаю. При этом в ушах играет дискография Би-2. Просыпаюсь среди ночи в мучениях, оттого что мне надо по текстам их песен составить вопросы с вариантами ответов, а не получается ((\r\n\r\nУуу: \r\nда ладно, это ж просто!\r\nВопрос: Кто не пишет полковнику?\r\nВарианты ответов:\r\n1) полковнику никто не пишет;\r\n2) полковнику пишут все;\r\n3) полковнику можно написать только в случае крайней необходимости', 999),
(1837, '432007', '2015-01-21 10:45', 7177, 'Пришел мастер повесить люстру. Попросил пассатижи. Дала. Попросил крестовую отвертку. Дала. Расставила стремянку. Ну одинокая женщина, дома есть все инструменты, вплоть до шуруповерта. А сантехнику я не понимаю и электричества боюсь.\r\n- Ой, че-та индикатор не работает.\r\nДала индикатор. Потихоньку зверею.\r\n- А изолента есть у вас?\r\n- Мужик, тебе пару рук не надо? Или мне тебе показать, как люстры вешать?\r\nОбиделся.', 999),
(1838, '432006', '2015-01-21 10:13', 3189, '- Чем завтра заниматься собираешься?\r\n- Завтра, по плану - группен-секс.\r\n- Ух, ты, а кто согласился, с одной стороны, с другой?\r\n- Не поверишь, согласились все. С одной стороны – наша группа. С другой - кафедра математики. Экзамен у нас.', 999),
(1839, '432005', '2015-01-21 10:12', 5834, '(разговор про НГ-пати):\r\n- А у нас трубу прорвало прям в разгар, так что думаешь, наша неподражаемая в состоянии "ноги разъезжаются, глаза в кучку" несется к соседу! в полчетветротого НОВОГОДНЕЙ НОЧИ! за разводным ключом! и с криком "щаявсесделаю!"...\r\n- Отож! знаю я эти истории, у наших "милых, скромных, хороших" где-то после пятой рюмки настроение резко меняется на "Выпускайте коней! Поджигайте избу!" =)', 999),
(1840, '432004', '2015-01-21 09:46', 834, 'ТатьянА.: а еще я слышу как у меня поскрипывает содержимое ноута, это нормально?', 999),
(1841, '432003', '2015-01-21 09:44', 8760, 'Едем в машине я (28 лет), шеф (76 лет), сотрудница (62) и водитель (50).\r\nШефа потянуло на философию: - Я вот верю в дружбу между мужчиной и женщиной.\r\nК сотруднице: - А ты веришь?\r\nС: - Конечно верю!\r\nКо мне: - А ты?\r\nЯ: Нет, я как-то не верю.\r\nК водителю: - А вот ты веришь?\r\nВ (задумчиво): - Да, ещё лет пять, и я поверю....', 999),
(1842, '432002', '2015-01-21 09:44', 2114, 'разговор с другом который все время нянчит племяшку:\r\nХХХ: Блин, у всех дети от секса, а у тебя из-за детей его нет...', 999),
(1843, '432001', '2015-01-21 09:13', 3919, 'К слову о бизнесах:\r\nЕсть у меня знакомая. А у нее бультерьер. Собака это лысая, и подруга связала для бульки свитер. А тут похолодало. И смотрим, вокруг наших собак нарезает круги дворник, да еще так настойчиво. Спросили.\r\nБеднягу интересовал не пес, а свитер, и он даже заказал себе такой. Теперь у подруги заказов на пару месяцев вперед. Вот что делают зима и дружба народов.', 999),
(1844, '432000', '2015-01-21 08:46', 3912, 'Ща вывалила на диван перед мужем таз с высушенными его носками:"А теперь играем в Маджонг!"', 999),
(1845, '431999', '2015-01-21 08:13', 4337, 'любимый решил мне помочь с домашними делами: начал гладить шторы\r\n\r\nоказалось, что у меня гладильная доска не той конструкции, она должна быть снизу прозрачная(!!!) и железная (!!!!), поэтому на моей доске тепло не уходит вниз, а остается в доске и погладить шторы хорошо не удастся\r\n\r\nпотом он уронил утюг, обжегся, сматюгнулся\r\nпотребовал суперклей, т.к. "от утюга отлетел кусочек и он счас все починит"\r\nсуперклей оказался не вскрытым, инструкция к нему была мелким шрифтом...\r\nно при помощи суперклея, матерков и пинцета для выщипывания бровей, взятого из маникюрного набора суровый челябинский мужик склеил утюг, поставил его сушиться и с чувством выполненного долга сел ковырять компьютер.\r\nУтюг пришла понюхать кошка, расчихалась, прослезилась, ее уволокли в ванную "промыть глазоньки". Из ванной долго раздавались вопли раненого леопарда пополам с шипением.\r\nПотом двое зализывали боевые раны на диване.\r\n\r\nPS боюсь шторы вешать', 999),
(1846, '431998', '2015-01-21 08:12', 4156, 'В гостях у предков. Зашел на кухню, моя жена и моя мама тихонько курлыкают под Футураму.\r\nВспомнилось, как моя жена, тогда еще моя девушка, с большой настороженностью относившаяся к будущей свекрови, зачем-то зашла на кухню и застала мою матушку плачущей за нарезкой овощей под серию про собачку Фрая. Они тогда вместе всплакнули и теперь не разлей вода :-)', 999),
(1847, '431997', '2015-01-21 08:11', 3279, 'xxx: Ты когда последний раз бумажное письмо писал?\r\nyyy: ХЗ, вообще не помню!\r\nxxx: Я вчера адски тупил на конверт. Заклеил. Написал адрес. Где писать тему письма???', 999),
(1848, '431996', '2015-01-20 14:13', 3239, 'xxx: а у тебя ударение на какую букву в фамилии?\r\nyyy: на первую\r\nxxx: на М что ли?\r\nyyy: да', 999);
